// file_ilk_revert_nece
vars: uint256 ward, uint256 live, bool revert1, bool revert2, bool revert3, bool revert4
spec: finished(Vat.file(ilk, what, data), (~(((ward = (wards(sender))) && (live = (live())) && (revert1 = (value > 0)) && (revert2 = (ward != 1)) && (revert3 = (live != 1)) && (revert4 = (what != 0x73706f7400000000000000000000000000000000000000000000000000000000 && what != 0x6c696e6500000000000000000000000000000000000000000000000000000000 && what != 0x6475737400000000000000000000000000000000000000000000000000000000))) ==> (revert1 || revert2 || revert3 || revert4))) |=> true)